import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import { withStyles } from '@material-ui/styles';
import { red } from "@mui/material/colors";
import { minHeight } from "@mui/system";


const useStyles = theme => ({
    root: {

    },
    tabs: {
        minWidth: 50,
    },
    tab: {
        minHeight: "auto",
        padding: 0,
        fontS
    }
});

class NavTop extends Component {

    render(){

        const showNav = this.props.state.showNav

        return(
            <>
                <div className={`reset-options-container nav-top-${showNav ? 'active' : 'inactive'}`}>

                </div>
                <div className="progress-bar-container">

                </div>
                <div className={`speed-options-container nav-top-${showNav ? 'active' : 'inactive'}`} sx={{ width: '100%' }}>
                <Tabs
                    // value={value}
                    // onChange={handleChange}
                    textColor="secondary"
                    indicatorColor="secondary"
                    aria-label="secondary tabs example"
                    className={this.props.classes.tabs}
                    variant="fullWidth"
                >
                    <Tab className={this.props.classes.tab} value="one" label="Slow" />
                    <Tab className={this.props.classes.tab} value="two" label="Normal" />
                    <Tab className={this.props.classes.tab} value="three" label="Fast" />
                </Tabs>
                </div>
            </>
        )
    }
}

export default withStyles(useStyles)(NavTop)
